import React from 'react';


function add(a, b) {
    let sum = a + b;
    return sum;
}

function sub(a, b) {
    let sub = a - b;
    return sub;
}

function mul(a, b) {
    let mul = a * b;
    return mul;
}

function div(a, b) {
    let div = a / b;
    return div;
    div = div.toFixed();
}
export { add, sub, mul, div };
